    pub fn new(subscriptions: SubscriptionManager) -> Self {
        Self {
            subscriptions,
            sequence: AtomicI64::new(0),
        }
    }

    /// Gets the next sequence number for events.
    fn next_sequence(&self) -> i64 {
        self.sequence.fetch_add(1, Ordering::SeqCst)
