    10/// Supabase REST API client for device and session secret operations.
    11#[derive(Clone)]
    12pub struct SupabaseClient {
    13    http_client: reqwest::Client,
    14    api_url: String,
    15    anon_key: String,
    16}
    17
    18/// Device information returned from Supabase.
    19#[derive(Debug, Clone, Serialize, Deserialize)]
    20pub struct DeviceInfo {
    21    /// Device UUID
    22    pub id: String,
    23    /// User ID who owns this device
    24    pub user_id: String,
    25    /// Device type (macos, ios, daemon, cli)
    26    pub device_type: String,
    27    /// Device display name
    28    pub name: String,
    29    /// Base64-encoded X25519 public key (may be None if not registered)
    30    pub public_key: Option<String>,
    31    /// Whether the device is active
    32    pub is_active: bool,
    33}
    34
    35/// Encrypted session secret record for a device.
    36#[derive(Debug, Clone, Serialize, Deserialize)]
    37pub struct CodingSessionSecretRecord {
    38    /// Session UUID
    39    pub session_id: String,
    40    /// Device UUID this secret is encrypted for
    41    pub device_id: String,
    42    /// Base64-encoded X25519 ephemeral public key
    43    pub ephemeral_public_key: String,
    44    /// Base64-encoded encrypted secret: nonce(12) || ciphertext || tag(16)
    45    pub encrypted_secret: String,
    46}
    47
    48/// Request body for inserting session secrets.
    49#[derive(Debug, Serialize)]
    50struct InsertSecretRequest {
    51    session_id: String,
