    57impl SupabaseClient {
    58    /// Create a new Supabase client.
    59    ///
    60    /// # Arguments
    61    /// * `api_url` - The Supabase project API URL (e.g., `https://xyz.supabase.co`)
    62    /// * `anon_key` - The Supabase anonymous API key
    63    pub fn new(api_url: impl Into<String>, anon_key: impl Into<String>) -> Self {
    64        Self {
    65            http_client: reqwest::Client::new(),
    66            api_url: api_url.into(),
    67            anon_key: anon_key.into(),
    68        }
    69    }
    70
    71    /// Build the REST API URL for a table.
    72    fn rest_url(&self, table: &str) -> String {
    73        format!("{}/rest/v1/{}", self.api_url, table)
    74    }
    75
    76    /// Fetch all active devices for a user (excluding a specific device).
    77    ///
    78    /// Only returns devices that have a public key set (for encryption).
    79    ///
    80    /// # Arguments
    81    /// * `user_id` - The user's UUID
    82    /// * `exclude_device_id` - Device ID to exclude (typically this device)
    83    /// * `access_token` - Supabase access token for authentication
    84    pub async fn fetch_user_devices(
    85        &self,
    86        user_id: &str,
    87        exclude_device_id: &str,
    88        access_token: &str,
    89    ) -> AuthResult<Vec<DeviceInfo>> {
    90        let url = format!(
    91            "{}?user_id=eq.{}&id=neq.{}&is_active=eq.true&public_key=not.is.null&select=id,user_id,device_type,name,public_key,is_active",
    92            self.rest_url("devices"),
    93            user_id,
    94            exclude_device_id
    95        );
    96
    97        tracing::debug!("Fetching devices from Supabase: {}", url);
    98
    99        let response = self
   100            .http_client
   101            .get(&url)
   102            .header("apikey", &self.anon_key)
   103            .header("Authorization", format!("Bearer {}", access_token))
   104            .header("Accept", "application/json")
   105            .send()
   106            .await?;
   107
   108        if !response.status().is_success() {
   109            let status = response.status();
   110            let body = response.text().await.unwrap_or_default();
   111            tracing::error!("Failed to fetch devices: {} - {}", status, body);
   112            return Err(AuthError::OAuth(format!(
   113                "Failed to fetch devices: {} - {}",
   114                status, body
   115            )));
   116        }
   117
   118        let devices: Vec<DeviceInfo> = response.json().await?;
   119        tracing::debug!("Fetched {} devices with public keys", devices.len());
   120        Ok(devices)
   121    }
