   123    /// Fetch or create this device in Supabase.
   124    ///
   125    /// If the device doesn't exist, creates it. If it exists, updates the public key.
   126    ///
   127    /// # Arguments
   128    /// * `device_id` - This device's UUID
   129    /// * `user_id` - The user's UUID
   130    /// * `device_type` - Device type (mac-desktop, win-desktop, linux-desktop, etc.)
   131    /// * `device_name` - Display name for the device
   132    /// * `public_key` - Base64-encoded X25519 public key
   133    /// * `access_token` - Supabase access token
   134    pub async fn upsert_device(
   135        &self,
   136        device_id: &str,
   137        user_id: &str,
   138        device_type: &str,
   139        device_name: &str,
   140        public_key: &str,
   141        access_token: &str,
