   143        let url = self.rest_url("devices");
   144
   145        // Get current timestamp in ISO8601 format
   146        let now = chrono::Utc::now().to_rfc3339();
   147
   148        let body = serde_json::json!({
   149            "id": device_id,
   150            "user_id": user_id,
   151            "device_type": device_type,
