    81    /// Create a new relay client with the given configuration.
    82    pub fn new(config: RelayConfig) -> Self {
    83        let (event_tx, _) = broadcast::channel(100);
    84
    85        Self {
    86            config,
    87            state: Arc::new(RwLock::new(ConnectionState::Disconnected)),
    88            current_session: Arc::new(RwLock::new(None)),
    89            sender: Arc::new(Mutex::new(None)),
    90            event_tx,
    91            auth_token: Arc::new(RwLock::new(None)),
    92            device_id: Arc::new(RwLock::new(None)),
    93            reconnect_attempts: Arc::new(RwLock::new(0)),
    94        }
    95    }
