   107    /// Get the current connection state.
   108    pub async fn state(&self) -> ConnectionState {
   109        *self.state.read().await
   110    }
   111
   112    /// Check if connected.
   113    pub async fn is_connected(&self) -> bool {
   114        *self.state.read().await == ConnectionState::Connected
   115    }
