   122    /// Connect to the relay server.
   123    pub async fn connect(&self, auth_token: &str, device_id: &str) -> RelayResult<()> {
   124        let current_state = *self.state.read().await;
   125        if current_state != ConnectionState::Disconnected {
   126            debug!("Already connecting or connected");
   127            return Ok(());
   128        }
   129
   130        // Store credentials for reconnection
   131        *self.auth_token.write().await = Some(auth_token.to_string());
   132        *self.device_id.write().await = Some(device_id.to_string());
   133
   134        self.do_connect().await
   135    }
   136
   137    /// Internal connect implementation.
   138    async fn do_connect(&self) -> RelayResult<()> {
   139        *self.state.write().await = ConnectionState::Connecting;
   140        info!(url = %self.config.url, "Connecting to relay");
   141
   142        // Connect to WebSocket
   143        let (ws_stream, _) = connect_async(&self.config.url).await?;
   144        let (mut write, mut read) = ws_stream.split();
   145
   146        // Create message channel
   147        let (msg_tx, mut msg_rx) = mpsc::channel::<Message>(100);
   148        *self.sender.lock().await = Some(msg_tx.clone());
   149
   150        *self.state.write().await = ConnectionState::Authenticating;
   151
   152        // Send authentication
   153        let auth_token = self.auth_token.read().await.clone()
   154            .ok_or_else(|| RelayError::Authentication("No auth token".to_string()))?;
   155        let device_id = self.device_id.read().await.clone()
   156            .ok_or_else(|| RelayError::Authentication("No device ID".to_string()))?;
   157
   158        let auth_msg = RelayMessage::auth(&auth_token, &device_id);
   159        let auth_json = auth_msg.to_json()?;
   160        write.send(Message::Text(auth_json.into())).await?;
   161        debug!("Sent AUTH message");
   162
   163        // Spawn message sender task
   164        let sender_handle = tokio::spawn(async move {
   165            while let Some(msg) = msg_rx.recv().await {
   166                if write.send(msg).await.is_err() {
   167                    break;
   168                }
   169            }
   170        });
   171
   172        // Spawn heartbeat task
   173        let heartbeat_sender = msg_tx.clone();
   174        let heartbeat_interval = self.config.heartbeat_interval_secs;
   175        let heartbeat_handle = tokio::spawn(async move {
   176            let mut interval = interval(Duration::from_secs(heartbeat_interval));
   177            loop {
   178                interval.tick().await;
   179                let heartbeat = RelayMessage::heartbeat();
   180                if let Ok(json) = heartbeat.to_json() {
   181                    if heartbeat_sender.send(Message::Text(json.into())).await.is_err() {
   182                        break;
   183                    }
   184                }
   185            }
   186        });
   187
   188        // Process incoming messages
   189        let state = self.state.clone();
   190        let event_tx = self.event_tx.clone();
   191        let current_session = self.current_session.clone();
   192        let reconnect_attempts = self.reconnect_attempts.clone();
   193
   194        while let Some(msg_result) = read.next().await {
   195            match msg_result {
   196                Ok(Message::Text(text)) => {
   197                    match RelayMessage::from_json(&text) {
   198                        Ok(relay_msg) => {
   199                            self.handle_message(&relay_msg, &state, &event_tx, &current_session, &reconnect_attempts).await;
   200                        }
   201                        Err(e) => {
   202                            warn!(error = %e, "Failed to parse relay message");
   203                        }
   204                    }
   205                }
   206                Ok(Message::Close(_)) => {
   207                    info!("Relay connection closed");
   208                    break;
   209                }
   210                Ok(Message::Ping(data)) => {
   211                    if let Some(sender) = self.sender.lock().await.as_ref() {
   212                        let _ = sender.send(Message::Pong(data)).await;
   213                    }
   214                }
   215                Ok(_) => {}
   216                Err(e) => {
   217                    error!(error = %e, "WebSocket error");
   218                    break;
   219                }
   220            }
   221        }
   222
   223        // Cleanup
   224        heartbeat_handle.abort();
   225        sender_handle.abort();
   226        *self.sender.lock().await = None;
   227        *self.state.write().await = ConnectionState::Disconnected;
   228        *self.current_session.write().await = None;
   229
   230        let _ = self.event_tx.send(RelayEvent::Disconnected(None));
   231
   232        // Attempt reconnection
   233        self.schedule_reconnect().await;
   234
   235        Ok(())
   236    }
