   238    /// Handle incoming relay message.
   239    async fn handle_message(
   240        &self,
   241        msg: &RelayMessage,
   242        state: &Arc<RwLock<ConnectionState>>,
   243        event_tx: &broadcast::Sender<RelayEvent>,
   244        current_session: &Arc<RwLock<Option<String>>>,
   245        reconnect_attempts: &Arc<RwLock<u32>>,
   246    ) {
   247        match msg.msg_type {
   248            RelayMessageType::AuthResult => {
   249                if msg.success == Some(true) {
   250                    *state.write().await = ConnectionState::Connected;
   251                    *reconnect_attempts.write().await = 0;
   252                    info!("Authenticated with relay");
   253                    let _ = event_tx.send(RelayEvent::Authenticated);
   254                    let _ = event_tx.send(RelayEvent::Connected);
   255                } else {
   256                    let error = msg.error.clone().unwrap_or_else(|| "Unknown error".to_string());
   257                    *state.write().await = ConnectionState::Disconnected;
   258                    error!(error = %error, "Authentication failed");
   259                    let _ = event_tx.send(RelayEvent::AuthenticationFailed(error));
   260                }
   261            }
   262            RelayMessageType::Subscribed => {
   263                if let Some(session_id) = &msg.session_id {
   264                    *current_session.write().await = Some(session_id.clone());
   265                    info!(session_id = %session_id, "Joined session");
   266                    let _ = event_tx.send(RelayEvent::SessionJoined(session_id.clone()));
   267                }
   268            }
   269            RelayMessageType::Unsubscribed => {
   270                if let Some(session_id) = &msg.session_id {
   271                    if current_session.read().await.as_deref() == Some(session_id) {
   272                        *current_session.write().await = None;
   273                    }
   274                    info!(session_id = %session_id, "Left session");
   275                    let _ = event_tx.send(RelayEvent::SessionLeft(session_id.clone()));
   276                }
   277            }
   278            RelayMessageType::Error => {
   279                let error = msg.error.clone().unwrap_or_else(|| "Unknown error".to_string());
   280                warn!(error = %error, "Relay error");
   281                let _ = event_tx.send(RelayEvent::Error(error));
   282            }
   283            _ => {
   284                debug!(msg_type = ?msg.msg_type, "Received message");
   285                let _ = event_tx.send(RelayEvent::Message(msg.clone()));
   286            }
   287        }
   288    }
