   290    /// Schedule automatic reconnection.
   291    async fn schedule_reconnect(&self) {
   292        let mut attempts = self.reconnect_attempts.write().await;
   293        *attempts += 1;
   294
   295        if *attempts > self.config.max_reconnect_attempts {
   296            warn!("Max reconnect attempts reached");
   297            return;
   298        }
   299
   300        // Calculate delay with exponential backoff
   301        let delay = std::cmp::min(
   302            self.config.reconnect_base_delay_secs * 2u64.pow(*attempts - 1),
   303            self.config.reconnect_max_delay_secs,
   304        );
   305
   306        info!(attempt = *attempts, delay_secs = delay, "Scheduling reconnect");
   307
   308        drop(attempts);
   309
   310        tokio::time::sleep(Duration::from_secs(delay)).await;
   311
   312        if self.auth_token.read().await.is_some() {
   313            if let Err(e) = Box::pin(self.do_connect()).await {
   314                error!(error = %e, "Reconnect failed");
   315            }
   316        }
   317    }
   318
   319    /// Disconnect from the relay.
   320    pub async fn disconnect(&self) {
   321        *self.reconnect_attempts.write().await = self.config.max_reconnect_attempts + 1;
   322
   323        if let Some(sender) = self.sender.lock().await.take() {
   324            drop(sender);
   325        }
   326
   327        *self.state.write().await = ConnectionState::Disconnected;
   328        *self.current_session.write().await = None;
   329        *self.auth_token.write().await = None;
   330        *self.device_id.write().await = None;
   331
   332        info!("Disconnected from relay");
   333        let _ = self.event_tx.send(RelayEvent::Disconnected(Some("User disconnected".to_string())));
   334    }
   335
   336    /// Join a session.
   337    pub async fn join_session(&self, session_id: &str) -> RelayResult<()> {
   338        if !self.is_connected().await {
   339            return Err(RelayError::NotConnected);
   340        }
   341
   342        let msg = RelayMessage::join_session(session_id);
   343        self.send_message(msg).await
   344    }
   345
   346    /// Leave the current session.
   347    pub async fn leave_session(&self) -> RelayResult<()> {
   348        if !self.is_connected().await {
   349            return Err(RelayError::NotConnected);
   350        }
   351
   352        let session_id = self.current_session.read().await.clone()
   353            .ok_or_else(|| RelayError::Session("Not in a session".to_string()))?;
   354
   355        let msg = RelayMessage::leave_session(&session_id);
   356        self.send_message(msg).await
   357    }
   358
   359    /// Send a message to the relay.
   360    pub async fn send_message(&self, msg: RelayMessage) -> RelayResult<()> {
   361        let sender = self.sender.lock().await;
   362        let sender = sender.as_ref().ok_or(RelayError::NotConnected)?;
   363
   364        let json = msg.to_json()?;
   365        sender.send(Message::Text(json.into())).await
   366            .map_err(|e| RelayError::Send(e.to_string()))
   367    }
   368
   369    /// Send raw JSON to the relay.
   370    pub async fn send_raw(&self, json: &str) -> RelayResult<()> {
   371        let sender = self.sender.lock().await;
   372        let sender = sender.as_ref().ok_or(RelayError::NotConnected)?;
   373
   374        sender.send(Message::Text(json.to_string().into())).await
   375            .map_err(|e| RelayError::Send(e.to_string()))
   376    }
   377}
