    10/// Outbox manager coordinates per-session outbox queues.
    11pub struct OutboxManager {
    12    db: Arc<Database>,
    13    queues: RwLock<HashMap<String, Arc<OutboxQueue>>>,
    14    sender_config: SenderConfig,
    15    auth_token: RwLock<Option<String>>,
    16}
    17
    18impl OutboxManager {
    19    /// Create a new outbox manager.
    20    pub fn new(db: Arc<Database>, sender_config: SenderConfig) -> Self {
    21        Self {
    22            db,
    23            queues: RwLock::new(HashMap::new()),
    24            sender_config,
    25            auth_token: RwLock::new(None),
    26        }
    27    }
    28
    29    /// Set the authentication token for the sender.
    30    pub async fn set_auth_token(&self, token: &str) {
    31        *self.auth_token.write().await = Some(token.to_string());
    32    }
    33
    34    /// Get or create an outbox queue for a session.
    35    pub async fn get_or_create_queue(&self, session_id: &str) -> OutboxResult<Arc<OutboxQueue>> {
    36        // Check if queue already exists
    37        {
    38            let queues = self.queues.read().await;
    39            if let Some(queue) = queues.get(session_id) {
    40                return Ok(queue.clone());
    41            }
    42        }
    43
    44        // Create new queue
    45        let queue = Arc::new(OutboxQueue::new(session_id, self.db.clone())?);
    46        queue.recover().await?;
    47
    48        let mut queues = self.queues.write().await;
    49        queues.insert(session_id.to_string(), queue.clone());
    50
    51        info!(session_id = %session_id, "Created outbox queue");
    52        Ok(queue)
    53    }
    54
    55    /// Remove a queue when session is closed.
    56    pub async fn remove_queue(&self, session_id: &str) {
    57        let mut queues = self.queues.write().await;
    58        if queues.remove(session_id).is_some() {
    59            info!(session_id = %session_id, "Removed outbox queue");
    60        }
    61    }
    62
    63    /// Enqueue an event for a session.
    64    pub async fn enqueue(&self, session_id: &str, message_id: &str) -> OutboxResult<()> {
    65        let queue = self.get_or_create_queue(session_id).await?;
    66        queue.enqueue(message_id).await
    67    }
    68
    69    /// Process pending events for a session.
    70    ///
    71    /// This should be called periodically or when new events are enqueued.
    72    pub async fn process_session(&self, session_id: &str) -> OutboxResult<()> {
    73        let queue = self.get_or_create_queue(session_id).await?;
    74        let auth_token = self.auth_token.read().await.clone();
    75
    76        let auth_token = match auth_token {
    77            Some(token) => token,
    78            None => {
    79                warn!(session_id = %session_id, "No auth token, skipping processing");
    80                return Ok(());
    81            }
    82        };
    83
    84        let sender = PipelineSender::new(self.sender_config.clone(), &auth_token);
    85
    86        // Process batches until queue is empty or max in-flight reached
    87        loop {
    88            let batch = match queue.get_next_batch().await? {
    89                Some(b) => b,
    90                None => break,
    91            };
    92
    93            let batch_id = batch.batch_id.clone();
    94
    95            match sender.send_batch(&batch).await {
    96                Ok(()) => {
    97                    queue.acknowledge_batch(&batch_id).await?;
    98                }
    99                Err(e) => {
   100                    warn!(
   101                        session_id = %session_id,
   102                        batch_id = %batch_id,
   103                        error = %e,
   104                        "Batch send failed"
   105                    );
   106                    queue.retry_batch(batch).await?;
   107                    // Don't continue processing after a failure
   108                    break;
   109                }
   110            }
   111        }
   112
   113        Ok(())
   114    }
   115
   116    /// Process all sessions with pending events.
   117    pub async fn process_all(&self) -> OutboxResult<()> {
   118        let session_ids: Vec<String> = {
   119            let queues = self.queues.read().await;
   120            queues.keys().cloned().collect()
   121        };
   122
   123        for session_id in session_ids {
   124            if let Err(e) = self.process_session(&session_id).await {
   125                warn!(session_id = %session_id, error = %e, "Error processing session");
   126            }
   127        }
   128
   129        Ok(())
   130    }
   131
   132    /// Get status for all queues.
   133    pub async fn get_status(&self) -> HashMap<String, QueueStatus> {
   134        let queues = self.queues.read().await;
   135        let mut status = HashMap::new();
   136
   137        for (session_id, queue) in queues.iter() {
   138            status.insert(session_id.clone(), QueueStatus {
   139                pending: queue.pending_count().await,
   140                in_flight: queue.in_flight_count().await,
   141            });
   142        }
   143
   144        status
   145    }
   146
   147    /// Get the number of active queues.
   148    pub async fn queue_count(&self) -> usize {
   149        self.queues.read().await.len()
   150    }
   151}
