     7/// Register message handlers.
     8pub async fn register(server: &IpcServer, state: DaemonState) {
     9    register_message_list(server, state.clone()).await;
    10    register_message_send(server, state).await;
    11}
    12
    13async fn register_message_list(server: &IpcServer, state: DaemonState) {
    14    server
    15        .register_handler(Method::MessageList, move |req| {
    16            let armin = state.armin.clone();
    17            async move {
    18                let session_id = req
    19                    .params
    20                    .as_ref()
    21                    .and_then(|p| p.get("session_id"))
    22                    .and_then(|v| v.as_str())
    23                    .map(String::from);
    24
    25                let Some(session_id) = session_id else {
    26                    return Response::error(
    27                        &req.id,
    28                        error_codes::INVALID_PARAMS,
    29                        "session_id is required",
    30                    );
    31                };
    32
    33                let session_id_clone = session_id.clone();
    34                let armin_session_id = SessionId::from_string(&session_id);
    35
    36                // Get messages from Armin (snapshot + delta)
    37                let snapshot = armin.snapshot();
    38                let delta = armin.delta(&armin_session_id);
    39
    40                // Combine snapshot and delta messages
    41                let mut messages = Vec::new();
    42
    43                // Add snapshot messages
    44                if let Some(session) = snapshot.session(&armin_session_id) {
    45                    for m in session.messages() {
    46                        messages.push(serde_json::json!({
    47                            "id": m.id.as_str(),
    48                            "session_id": session_id_clone,
    49                            "content": m.content,
    50                            "sequence_number": m.sequence_number,
    51                        }));
    52                    }
    53                }
    54
    55                // Add delta messages
    56                for m in delta.messages() {
    57                    messages.push(serde_json::json!({
    58                        "id": m.id.as_str(),
    59                        "session_id": session_id_clone,
    60                        "content": m.content,
    61                        "sequence_number": m.sequence_number,
    62                    }));
    63                }
    64
    65                Response::success(
    66                    &req.id,
    67                    serde_json::json!({
    68                        "session_id": session_id_clone,
    69                        "messages": messages,
    70                    }),
    71                )
    72            }
    73        })
    74        .await;
    75}
    76
    77async fn register_message_send(server: &IpcServer, state: DaemonState) {
    78    server
    79        .register_handler(Method::MessageSend, move |req| {
    80            let armin = state.armin.clone();
    81            async move {
    82                let session_id = req
    83                    .params
