{"type":"user","message":{"role":"user","content":[{"tool_use_id":"toolu_01CbTwxeLRHH9bf7HzRu4h3Q","type":"tool_result","content":"     1//! # Armin
     2//!
     3//! A SQLite-backed session engine that commits facts, derives fast read views, and emits side-effects.
     4//!
     5//! ## Non-negotiable Principles
     6//!
     7//! - **SQLite is the only durable store** - Every write commits to SQLite first
     8//! - **Snapshots, deltas, live streams are derived** - Reads never cause side-effects
     9//! - **Side-effects reflect committed reality** - Emitted after SQLite commit
    10//! - **Recovery emits nothing** - Crash = rebuild from SQLite
    11//! - **Performance is achieved via derivation, not mutation**
    12//!
    13//! ## Architecture
    14//!
    15//! ```text
    16//! WRITE:
    17//!   SQLite  derived state  side-effect
    18//!
    19//! READ:
    20//!   snapshot + delta + live
    21//!
    22//! CRASH:
    23//!   SQLite  rebuild  continue
    24//! ```
    25//!
    26//! ## Example
    27//!
    28//! ```rust
    29//! use armin::{Armin, Message, NewMessage, SessionReader, SessionWriter};
    30//! use armin::side_effect::{RecordingSink, SideEffect};
    31//!
    32//! // Create an in-memory engine for testing
    33//! let sink = RecordingSink::new();
    34//! let engine = Armin::in_memory(sink).unwrap();
    35//!
    36//! // Create a session
    37//! let session_id = engine.create_session();
    38//!
    39//! // Append messages
    40//! engine.append(&session_id, NewMessage {
    41//!     content: "Hello!".to_string(),
    42//! });
    43//!
    44//! // Read via delta
    45//! let delta = engine.delta(&session_id);
    46//! assert_eq!(delta.len(), 1);
    47//!
    48//! // Check side-effects were emitted
    49//! assert_eq!(engine.sink().len(), 2); // SessionCreated + MessageAppended
    50//! ```
