{"type":"user","message":{"role":"user","content":[{"tool_use_id":"toolu_019dB5ERwiq6J3W2GW3atKLF","type":"tool_result","content":"     1//! The Armin engine - the brain of the session engine.
     2//!
     3//! Armin coordinates writes, derived state, and side-effects.
     4//!
     5//! # Write Path (strict order)
     6//!
     7//! 1. Commit fact to SQLite
     8//! 2. Update derived state (delta, live)
     9//! 3. Emit side-effect
    10//!
    11//! If step 1 fails, nothing else runs.
    12//! Side-effects always observe committed state.
    13//!
    14//! # Recovery (silent)
    15//!
    16//! On startup:
    17//! 1. Open SQLite
    18//! 2. Load sessions
    19//! 3. Rebuild deltas
    20//! 4. Serve reads
    21//!
    22//! Recovery emits NO side-effects and NO live notifications.
    23
    24use std::collections::HashMap;
    25use std::path::Path;
    26use std::sync::Arc;
    27
    28use crate::delta::{DeltaStore, DeltaView};
    29use crate::live::{LiveHub, LiveSubscription};
    30use crate::reader::SessionReader;
    31use crate::side_effect::{SideEffect, SideEffectSink};
    32use crate::snapshot::{SessionSnapshot, SnapshotView};
    33use crate::sqlite::SqliteStore;
    34use crate::types::{
    35    AgentStatus, Message, NewMessage, NewOutboxEvent, NewRepository, NewSession,
    36    NewSessionSecret, OutboxEvent, Repository, RepositoryId, Session, SessionId,
    37    SessionSecret, SessionState, SessionStatus, SessionUpdate,
    38};
    39use crate::writer::SessionWriter;
    40use crate::ArminError;
    41
    42/// The Armin session engine.
    43///
    44/// Coordinates SQLite storage, derived state, and side-effects.
    45pub struct Armin<S: SideEffectSink> {
    46    sqlite: SqliteStore,
    47    delta: DeltaStore,
    48    live: LiveHub,
    49    sink: Arc<S>,
    50    /// Cached snapshot (rebuilt on startup, refreshed on demand)
    51    snapshot: std::sync::RwLock<SnapshotView>,
    52}
    53
    54impl<S: SideEffectSink> Armin<S> {
    55    /// Opens an Armin engine with a SQLite database at the given path.
    56    ///
    57    /// This performs recovery: it loads all sessions and messages from SQLite
    58    /// and rebuilds derived state. No side-effects are emitted during recovery.
    59    pub fn open(path: impl AsRef<Path>, sink: S) -> Result<Self, ArminError> {
    60        let sqlite = SqliteStore::open(path)?;
    61        Self::from_sqlite(sqlite, sink)
    62    }
    63
    64    /// Creates an Armin engine with an in-memory SQLite database.
    65    ///
    66    /// Useful for testing.
    67    pub fn in_memory(sink: S) -> Result<Self, ArminError> {
    68        let sqlite = SqliteStore::in_memory()?;
    69        Self::from_sqlite(sqlite, sink)
    70    }
    71
    72    /// Creates an Armin engine from an existing SQLite store.
    73    fn from_sqlite(sqlite: SqliteStore, sink: S) -> Result<Self, ArminError> {
    74        let delta = DeltaStore::new();
    75        let live = LiveHub::new();
    76
    77        let engine = Self {
    78            sqlite,
    79            delta,
    80            live,
    81            sink: Arc::new(sink),
    82            snapshot: std::sync::RwLock::new(SnapshotView::empty()),
    83        };
    84
    85        // Perform recovery (no side-effects)
    86        engine.recover()?;
    87
    88        Ok(engine)
    89    }
    90
    91    /// Recovers state from SQLite.
    92    ///
    93    /// This is called on startup and does NOT emit side-effects or live notifications.
    94    fn recover(&self) -> Result<(), ArminError> {
    95        tracing::info!("armin: starting recovery from SQLite");
    96
    97        // Load all sessions from agent_coding_sessions table
    98        let sessions = self.sqlite.list_all_agent_sessions()?;
    99        tracing::debug!("armin: found {} sessions", sessions.len());
   100
   101        // Build snapshot and initialize deltas
   102        let mut snapshot_sessions = HashMap::new();
   103
   104        for session in sessions {
   105            // Load messages for this session
   106            let messages = self.sqlite.get_agent_messages(&session.id)?;
   107            let last_message_id = messages.last().map(|m| m.id.clone());
   108
   109            // Initialize delta tracking with cursor at end of current messages
   110            self.delta.init_session(session.id.clone(), last_message_id);
   111
   112            // Sessions are "closed" if status is not active
   113            let closed = session.status != crate::types::SessionStatus::Active;
   114
   115            // Create snapshot
   116            snapshot_sessions.insert(
   117                session.id.clone(),
   118                SessionSnapshot::new(session.id.clone(), messages, closed),
   119            );
   120        }
   121
   122        // Update snapshot
   123        *self.snapshot.write().expect("lock poisoned") = SnapshotView::new(snapshot_sessions);
   124
   125        tracing::info!("armin: recovery complete");
   126        Ok(())
   127    }
   128
   129    /// Returns a reference to the side-effect sink.
   130    pub fn sink(&self) -> &S {
   131        &self.sink
   132    }
   133
   134    /// Refreshes the snapshot from current state.
   135    ///
   136    /// This rebuilds the snapshot from SQLite and clears all deltas.
   137    pub fn refresh_snapshot(&self) -> Result<(), ArminError> {
   138        let sessions = self.sqlite.list_all_agent_sessions()?;
   139        let mut snapshot_sessions = HashMap::new();
   140
   141        for session in sessions {
   142            let messages = self.sqlite.get_agent_messages(&session.id)?;
   143
   144            // Clear delta and update cursor
   145            self.delta.clear(&session.id);
   146
   147            let closed = session.status != crate::types::SessionStatus::Active;
   148
   149            snapshot_sessions.insert(
   150                session.id.clone(),
   151                SessionSnapshot::new(session.id.clone(), messages, closed),
   152            );
   153        }
   154
   155        *self.snapshot.write().expect("lock poisoned") = SnapshotView::new(snapshot_sessions);
   156        Ok(())
   157    }
   158}
   159
   160impl<S: SideEffectSink> SessionWriter for Armin<S> {
   161    // ========================================================================
   162    // Repository operations
   163    // ========================================================================
   164
   165    fn create_repository(&self, repo: NewRepository) -> Repository {
   166        // 1. Commit fact to SQLite
   167        let repository = self
   168            .sqlite
   169            .insert_repository(&repo)
   170            .expect("failed to create repository");
   171
   172        // 2. No derived state for repositories
   173
   174        // 3. Emit side-effect
   175        self.sink.emit(SideEffect::RepositoryCreated {
   176            repository_id: repository.id.clone(),
