        // 1. Commit fact to SQLite
        let deleted = self
            .sqlite
            .delete_agent_session(id)
            .expect("failed to delete session");

        if deleted {
            // 2. Update derived state
            self.live.close_session(id);
            self.delta.clear(id);

            // 3. Emit side-effect
            self.sink.emit(SideEffect::SessionDeleted {
                session_id: id.clone(),
