     2//!
     3//! This module provides the main `SideEffectSink` that syncs Armin's
     4//! side-effects to Supabase.
     5
     6use crate::client::SupabaseClient;
     7use armin::{SideEffect, SideEffectSink};
     8use std::sync::Arc;
     9use tokio::sync::RwLock;
    10use tracing::{debug, error, info};
    11
    12/// Context required for Supabase sync operations.
    13#[derive(Clone)]
    14pub struct SyncContext {
    15    /// Supabase access token for API authentication.
    16    pub access_token: String,
    17    /// User ID for ownership tracking.
    18    pub user_id: String,
    19    /// Device ID for this daemon instance.
    20    pub device_id: String,
    21}
    22
    23/// Toshinori: A SideEffectSink that syncs to Supabase.
    24///
    25/// When Armin commits facts to SQLite, Toshinori asynchronously syncs
    26/// those changes to Supabase for cross-device visibility.
    27///
    28/// # Thread Safety
    29///
    30/// Toshinori is thread-safe and can be shared across tasks. The sync
    31/// context can be updated at runtime (e.g., after token refresh).
    32pub struct ToshinoriSink {
    33    /// Supabase API client.
    34    client: SupabaseClient,
    35    /// Sync context (token, user_id, device_id).
    36    context: Arc<RwLock<Option<SyncContext>>>,
    37    /// Tokio runtime handle for spawning async tasks.
    38    runtime: tokio::runtime::Handle,
    39}
    40
    41impl ToshinoriSink {
    42    /// Create a new Toshinori sink.
    43    ///
    44    /// # Arguments
    45    /// * `api_url` - Supabase API URL
    46    /// * `anon_key` - Supabase anonymous key
    47    /// * `runtime` - Tokio runtime handle for async operations
    48    pub fn new(
    49        api_url: impl Into<String>,
    50        anon_key: impl Into<String>,
    51        runtime: tokio::runtime::Handle,
    52    ) -> Self {
    53        Self {
    54            client: SupabaseClient::new(api_url, anon_key),
    55            context: Arc::new(RwLock::new(None)),
    56            runtime,
    57        }
    58    }
    59
    60    /// Set the sync context (call after authentication).
    61    ///
    62    /// Until this is called, side-effects will be logged but not synced.
    63    pub async fn set_context(&self, context: SyncContext) {
    64        let mut ctx = self.context.write().await;
    65        *ctx = Some(context);
    66        info!("Toshinori sync context set");
    67    }
    68
    69    /// Clear the sync context (call on logout).
    70    pub async fn clear_context(&self) {
    71        let mut ctx = self.context.write().await;
    72        *ctx = None;
    73        info!("Toshinori sync context cleared");
    74    }
    75
    76    /// Check if sync is enabled (context is set).
    77    pub async fn is_enabled(&self) -> bool {
    78        self.context.read().await.is_some()
    79    }
    80
    81    /// Handle a side-effect asynchronously.
    82    fn handle_effect(&self, effect: SideEffect) {
    83        let client = self.client.clone();
    84        let context = self.context.clone();
    85
    86        self.runtime.spawn(async move {
    87            // Get context (if not set, just log and return)
    88            let ctx = {
    89                let guard = context.read().await;
    90                match guard.as_ref() {
    91                    Some(ctx) => ctx.clone(),
    92                    None => {
    93                        debug!(?effect, "Toshinori: skipping sync (no context)");
    94                        return;
    95                    }
    96                }
    97            };
    98
    99            // Sync based on effect type
   100            let result = match &effect {
   101                SideEffect::RepositoryCreated { repository_id } => {
   102                    client
   103                        .upsert_repository(
   104                            repository_id.as_str(),
   105                            &ctx.user_id,
   106                            &ctx.device_id,
   107                            &ctx.access_token,
   108                        )
   109                        .await
   110                }
   111
   112                SideEffect::RepositoryDeleted { repository_id } => {
   113                    client
   114                        .delete_repository(repository_id.as_str(), &ctx.access_token)
   115                        .await
   116                }
   117
   118                SideEffect::SessionCreated { session_id } => {
   119                    client
   120                        .upsert_session(
   121                            session_id.as_str(),
   122                            &ctx.user_id,
   123                            &ctx.device_id,
   124                            "active",
   125                            &ctx.access_token,
   126                        )
   127                        .await
   128                }
   129
   130                SideEffect::SessionClosed { session_id } => {
   131                    client
   132                        .update_session_status(session_id.as_str(), "closed", &ctx.access_token)
   133                        .await
   134                }
   135
   136                SideEffect::SessionDeleted { session_id } => {
   137                    client
   138                        .delete_session(session_id.as_str(), &ctx.access_token)
   139                        .await
   140                }
   141
   142                SideEffect::SessionUpdated { session_id } => {
   143                    // Session metadata update - just touch the heartbeat
   144                    client
   145                        .update_session_status(session_id.as_str(), "active", &ctx.access_token)
   146                        .await
   147                }
   148
   149                SideEffect::MessageAppended {
   150                    session_id,
   151                    message_id,
   152                } => {
   153                    // Note: We don't have the message content here.
   154                    // The actual sync would need to fetch from Armin or
   155                    // we need to extend the SideEffect to include content.
   156                    debug!(
   157                        session_id = session_id.as_str(),
   158                        message_id = message_id.as_str(),
   159                        "Toshinori: MessageAppended (content sync TBD)"
   160                    );
   161                    Ok(())
   162                }
   163
   164                SideEffect::AgentStatusChanged { session_id, status } => {
   165                    client
   166                        .update_agent_status(
   167                            session_id.as_str(),
   168                            status.as_str(),
   169                            &ctx.access_token,
   170                        )
   171                        .await
   172                }
   173
   174                SideEffect::OutboxEventsSent { batch_id } => {
   175                    debug!(batch_id, "Toshinori: OutboxEventsSent (no sync needed)");
   176                    Ok(())
   177                }
   178
   179                SideEffect::OutboxEventsAcked { batch_id } => {
   180                    debug!(batch_id, "Toshinori: OutboxEventsAcked (no sync needed)");
   181                    Ok(())
   182                }
   183            };
   184
   185            // Log errors but don't fail
   186            if let Err(e) = result {
   187                error!(?effect, error = %e, "Toshinori: failed to sync side-effect");
   188            }
   189        });
   190    }
   191}
   192
   193impl std::fmt::Debug for ToshinoriSink {
   194    fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result {
   195        f.debug_struct("ToshinoriSink").finish_non_exhaustive()
   196    }
   197}
   198
   199impl SideEffectSink for ToshinoriSink {
   200    fn emit(&self, effect: SideEffect) {
   201        debug!(?effect, "Toshinori: received side-effect");
   202        self.handle_effect(effect);
   203    }
   204}
