    20    RepositoryCreated { repository_id: RepositoryId },
    21    /// A repository was deleted.
    22    RepositoryDeleted { repository_id: RepositoryId },
    23
    24    // Session side-effects
    25    /// A new session was created.
    26    SessionCreated { session_id: SessionId },
