    41    /// Creates the database and schema if they don't exist.
    42    pub fn open(path: impl AsRef<Path>) -> SqliteResult<Self> {
    43        let conn = Connection::open(path)?;
    44        let store = Self {
    45            conn: Mutex::new(conn),
    46        };
    47        store.init_schema()?;
    48        Ok(store)
    49    }
